import React from 'react'

export default function EmailForm(props) {
    return (
        <div>
            <button className="btn btn-sm btn-secondary" onClick={() => props.clickAction()}>Back to comm selection</button>
            <h5>This is the email form</h5>
        </div>
    )
}
